import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function Navbar() {
  return (
    <View style={styles.container}>
      <Text>Home</Text>
      <Text>Login</Text>
      <Text>User Details</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex:1,
    width:100,
   display:'flex',
    flexDirection: 'row',
    backgroundColor: '#7fffd4',
    padding:10,
   
    paddingTop:40,
  
  },
});
